{{
    config(
        materialized = 'ephemeral'
    )
}}
select
    c_custkey as customer_key,
    c_name as customer_name,
    c_address as customer_address,
    c_nationkey as nation_key,
    c_phone as customer_phone_number,
    c_acctbal{{ money() }} as customer_account_balance,
    c_mktsegment as customer_market_segment_name,
    c_comment as customer_comment
from
    {{ source('tpch', 'customer') }}

{{
    config(
        materialized = 'table'
    )
}}
with customers as (

    select * from {{ ref('base_customer') }}

)
select 
    c.customer_key,
    c.customer_name,
    c.customer_address,
    c.nation_key,
    c.customer_phone_number,
    c.customer_account_balance,
    c.customer_market_segment_name
from
    customers c
order by
    c.customer_key
